import React from 'react';

function Card({ title }) {

  const defaultImage = "./upd/src/assets/images/banner/image.PNG"; 

  return (
    <div className="card">
      <img src={defaultImage} alt={title} className="card_img" />
      <div className="card_overlay"></div>

      <h2 className="card_title">{title}</h2>
    </div>
  );
}

export default Card;
